import React, { useState, useEffect } from 'react';
import axios from 'axios';
import { Link } from 'react-router-dom';

const Dashboard = () => {
  const [books, setBooks] = useState([]);
  const [loading, setLoading] = useState(true);
  const [showBooks, setShowBooks] = useState(false); // State to track visibility of books

  useEffect(() => {
    fetchBooks();
  }, []);

  const fetchBooks = async () => {
    try {
      const response = await axios.get('http://localhost:8080/api/books');
      setBooks(response.data);
      setLoading(false);
    } catch (error) {
      console.error('Error fetching books:', error);
    }
  };

  const toggleBooks = () => {
    setShowBooks(!showBooks); // Toggle the visibility of books
  };

  const deleteBook = async (id) => {
    try {
      await axios.delete(`http://localhost:8080/api/books/${id}`);
      // After successful deletion, fetch the updated list of books
      fetchBooks();
    } catch (error) {
      console.error('Error deleting book:', error);
    }
  };

  const renderBooks = () => {
    if (loading) {
      return <p>Loading...</p>;
    } else {
      return (
        <table style={{ display: showBooks ? 'block' : 'none', borderCollapse: 'collapse', width: '100%' }}>
          <thead>
            <tr>
              <th style={{ border: '1px solid #ddd', padding: '8px', textAlign: 'left', backgroundColor: '#f2f2f2' }}>Title</th>
              <th style={{ border: '1px solid #ddd', padding: '8px', textAlign: 'left', backgroundColor: '#f2f2f2' }}>Author</th>
              <th style={{ border: '1px solid #ddd', padding: '8px', textAlign: 'left', backgroundColor: '#f2f2f2' }}>Genre</th>
              <th style={{ border: '1px solid #ddd', padding: '8px', textAlign: 'left', backgroundColor: '#f2f2f2' }}>Actions</th> {/* New column for actions */}
            </tr>
          </thead>
          <tbody>
            {books.map(book => (
              <tr key={book.id}>
                <td style={{ border: '1px solid #ddd', padding: '8px' }}>{book.title}</td>
                <td style={{ border: '1px solid #ddd', padding: '8px' }}>{book.author}</td>
                <td style={{ border: '1px solid #ddd', padding: '8px' }}>{book.genre}</td>
                <td style={{ border: '1px solid #ddd', padding: '8px' }}>
                  <button onClick={() => deleteBook(book.id)} style={{ marginRight: '5px' }}>Delete</button>
                  <Link to={`/edit-book/${book.id}`}>
                    <button>Edit</button>
                  </Link>
                </td>
              </tr>
            ))}
          </tbody>
        </table>
      );
    }
  };

  return (
    <div style={{ padding: '20px' }}>
      <Link to="/reglog" style={{ position: 'absolute', top: '20px', left: '20px' }}>
        <button>Logout</button>
      </Link>
      <h2 style={{ marginBottom: '20px' }}>Welcome to Library Management Dashboard</h2>
      
      <Link to="/add-book">
        <button style={{ marginRight: '10px' }}>Add Book</button>
      </Link>
      <button onClick={toggleBooks} style={{ marginRight: '10px' }}>
        {showBooks ? 'Hide Books' : 'Show All Books'}
      </button>
      <br /><br />
      {renderBooks()}
    </div>
  );
};

export default Dashboard;
